import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <table style={{
          backgroundColor: '#000'
        }}>
          <tbody>
            <tr>
              <td>
                <img width="100" src="image2vector.svg"/>
              </td>
              <td>
                Movies DB Search
              </td>
            </tr>
          </tbody>
        </table>


      </div>
    );
  }
}

export default App;
